"use strict";(self.webpackChunknyu_cs_wiki=self.webpackChunknyu_cs_wiki||[]).push([[9176],{8709:e=>{e.exports=JSON.parse('{"label":"Student","permalink":"/docs/tags/student","allTagsPath":"/docs/tags","count":13,"items":[{"id":"Recreation/chipotle","title":"Chipotle","description":"Manhattan:","permalink":"/docs/Recreation/chipotle"},{"id":"Recreation/Athletics/club_sports","title":"Club Sports","description":"There are a number of club sports available to join. In order to participate, it is at least necessary to get an NYU Club Sports Examination form (an appointment can be scheduled from the Student Health Center). Depending on the sport, you may need to go through other forms as well. More information can be found on the main website. For signing up for sports, you can find that here.","permalink":"/docs/Recreation/Athletics/club_sports"},{"id":"Opportunities/Internal/clubs","title":"Clubs","description":"In general, there isn\'t a \\"best\\" way of finding clubs but there are a few resources that can be used to help find clubs. NYU Engage is the main campus-wide platform used and it can show a list of clubs that are available at NYU and provide reminders for upcoming events. A newer option is using the NYU student hub on Discord which can make it easy to discover more active clubs on campus. There are also the individual school club discovery pages though they often are not kept up to date (ex. CAS and Tandon).","permalink":"/docs/Opportunities/Internal/clubs"},{"id":"Recreation/discounts","title":"Discounts","description":"A list of discounts that NYU students can take advantage of.","permalink":"/docs/Recreation/discounts"},{"id":"Recreation/free","title":"Free Resources","description":"A list of useful free resources provided by NYU or are free for university students","permalink":"/docs/Recreation/free"},{"id":"Recreation/game_center","title":"Game Center","description":"The NYU Game Center is located on the 6th floor of 370 Jay Street, Brooklyn. It serves as a hub for game design students and enthusiasts across NYU. While it\'s part of the BFA/MFA in Game Design under the Tisch School of the Arts, many of its resources are open to all NYU students.","permalink":"/docs/Recreation/game_center"},{"id":"Recreation/Athletics/gyms","title":"Gyms","description":"NYU","permalink":"/docs/Recreation/Athletics/gyms"},{"id":"Opportunities/Hackathons/hackathons","title":"Hackathons","description":"If you\'re new to computer science, a hackathon is a great way to get your hands dirty on some real world projects that you are interested in. Imagine it as a sprint-like event where programmers, designers, and enthusiasts from various disciplines come together to create, build, and develop projects.","permalink":"/docs/Opportunities/Hackathons/"},{"id":"Opportunities/Hackathons/hackNYU","title":"HackNYU","description":"HackNYU is a 48-hour Global Hackathon Hosted by NYU. It\'s a great opportunity to showcase your problem solving skills and technical abilities.","permalink":"/docs/Opportunities/Hackathons/hackNYU"},{"id":"Recreation/housing","title":"Housing","description":"Housing is a crucial aspect of student life. Although New York City offers abundant living resources, it also demands considerable housing expenses. Finding an ideal home may require time and, occasionally, a bit of luck. Here are some popular on-campus and off-campus housing options for students, along with some helpful suggestions.","permalink":"/docs/Recreation/housing"},{"id":"Opportunities/resume","title":"Resume","description":"A solid resume allows you to showcase your skills and experiences, helping you highlight your competencies among other applicants for a job or research position. Here are some great resources you may refer to in order to build your own.","permalink":"/docs/Opportunities/resume"},{"id":"Opportunities/Internal/TA","title":"TA/Tutor","description":"Working as a Teaching Assistant (TA) or tutor presents a valuable and rewarding opportunity to engage with teaching on campus. By choosing an area that captivates you, you can support professors or aid fellow students in acquiring new knowledge, all the while reinforcing your own understanding of the material and receiving compensation. Additionally, these roles offer a chance to enhance your soft skills, including communication and presentation abilities. Explore the extensive opportunities available at CAS/Tandon and learn how to initiate your application process below.","permalink":"/docs/Opportunities/Internal/TA"},{"id":"Opportunities/VIP/vip","title":"Vertically Integrated Projects","description":"Vertically Integrated Projects (VIP) are a unique long-term and large-scale project led by a faculty member at NYU. After applying, accepted students enroll in a VIP course in Albert like any other class. VIP can be taken for credit, usually 1. Up to 6 credits can be earned over multiple semesters. Different VIP teams have different needs and requirements. Generally, you can expect to spend a couple hours per week on VIP. VIP is a great way to get involved in research and work on a project that you are passionate about. VIP is also a great way to meet other students and faculty.","permalink":"/docs/Opportunities/VIP/"}]}')}}]);